(53, 1, '2020-10-13 16:14:44', '2020-10-13 16:14:44', '<!-- wp:paragraph -->\n<p>Cho thu nh 3 tng nguyn cn Mt tin ng An Nhn 1 , Qun Sn Tr. gn cu Sng hn.<br> V tr: Khu tp dn c yn tnh, 5 pht i b n cu sng Hn v cch bin ch 200m.<br> Nh 3 tng gm phng khch rng, nh bp, sn trc, 3 PN ln c gn my lnh, 3wc.<br> Nh c ni tht g cao cp sang trng, t lnh, my git, iu ho v c h thng nc nng nng lng mt tri.<br> Din tch t : 4.5m x 20m<br> Din tch s dng 180m2.<br> Gi cho thu : 19 triu/ thng<br> Cc 1 thng , thanh ton 6 thng, u tin cho thu lu di.</p>\n<!-- /wp:paragraph -->', 'Cho thu nh 3 tng ng An Nhn 1, Qun Sn Tr. Gn cu Sng Hn.', '', 'trash', 'open', 'open', '', 'cho-thue-nha-3-tang-duong-an-nhon-1-quan-son-tra-gan-cau-song-han__trashed', '', '', '2020-11-06 16:25:13', '2020-11-06 16:25:13', '', 0, 'https://yenthinhbds.vn//?p=53', 0, 'post', '', 0),
