(2, '2020-10-31 03:20:42', 'annguyen78py@gmail.com', '[Sunnyland] Your site has updated to WordPress 5.5.3', 'Howdy! Your site at https://yenthinhbds.vn/ has been updated automatically to WordPress 5.5.3.\n\nNo further action is needed on your part. For more on version 5.5.3, see the About WordPress screen:\nhttps://yenthinhbds.vn//wp-admin/about.php\n\nIf you experience any issues or need support, the volunteers in the WordPress.org support forums may be able to help.\nhttps://wordpress.org/support/forums/\n\nThe WordPress Team\n', '', NULL),
(3, '2020-10-31 05:43:14', 'annguyen78py@gmail.com', '[Sunnyland] Your Site is Experiencing a Technical Issue', 'Howdy!\n\nSince WordPress 5.2 there is a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.\n\nIn this case, WordPress caught an error with your theme, sunnyland.\n\nFirst, visit your website (https://yenthinhbds.vn//) and check for any visible issues. Next, visit the page where the error was caught (https://yenthinhbds.vn//wp-admin/admin-ajax.php) and check for any visible issues.\n\nPlease contact your host for assistance with investigating this issue further.\n\nIf your site appears broken and you can\'t access your dashboard normally, WordPress now has a special \"recovery mode\". This lets you safely login to your dashboard and investigate further.\n\nhttps://yenthinhbds.vn//wp-login.php?action=enter_recovery_mode&rm_token=68EkTeuQFWhO3jfnDNT8oT&rm_key=ipFXdZhnTDBQjrTcdDspie\n\nTo keep your site safe, this link will expire in 1 day. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.\n\nWhen seeking help with this issue, you may be asked for some of the following information:\nWordPress version 5.5.3\r\nCurrent theme: sunnyland (version 1.0.0)\r\nCurrent plugin:  (version )\r\nPHP version 7.2.8\n\n\n\nError Details\n=============\nAn error of type E_PARSE was caused in line 297 of the file /Users/hoangan/project/sunnyland/wp-content/themes/sunnyland/functions.php. Error message: syntax error, unexpected \'}\'', '', NULL);
